import FeedIcon from "@mui/icons-material/Feed";
import MoreHorizIcon from "@mui/icons-material/MoreHoriz";
import {
  Card,
  IconButton,
  Typography,
  styled,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import * as React from "react";
import { useState } from "react";
import {
  CartesianGrid,
  Legend,
  Line,
  LineChart,
  ResponsiveContainer,
  Tooltip,
  XAxis,
  YAxis,
} from "recharts";
import DashTab from "../NavBar/DashTab";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export default function BasicGrid() {
  const [age, setAge] = React.useState("");

  const [selectedOption, setSelectedOption] = useState("");

  const handleChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const data = [
    { name: "Jan", value: 200 },
    { name: "Feb", value: 140 },
    { name: "March", value: 210 },
    { name: "April", value: 360 },
    { name: "June", value: 210 },
    { name: "July", value: 250 },
  ];

  const cardStyle = {
    padding: "15px 20px",
    margin: "20px",
    width: "100px",
    height: "100px",
    // border: "1px solid blue",
    borderRadius: "10px",
    background: "linear-gradient(to right, rgb(0, 0, 255), rgb(128, 0, 128))",
  };

  const theme = useTheme();
  const isSmallScreen = useMediaQuery(theme.breakpoints.down("sm"));

  return (
    <>
      <Grid>
        <Box sx={{ flexGrow: 1, marginTop: "3%" }}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6} sx={{ height: "100%" }}>
              <Card
                sx={{
                  width: "100%",
                  display: "flex",
                  flexDirection: "column",
                }}
              >
                <Box
                  sx={{
                    display: "flex",
                    flexDirection: "row",
                    alignItems: "center",
                    justifyContent: "space-between",
                  }}
                >
                  <strong
                    style={{
                      fontWeight: "bold",
                      padding: "30px",
                      fontSize: "30px",
                    }}
                  >
                    Sales
                  </strong>

                  <IconButton
                    size="large"
                    aria-label="display more actions"
                    edge="end"
                    color="inherit"
                  >
                    <MoreHorizIcon />
                  </IconButton>
                </Box>

                <Box
                  sx={{
                    display: "flex",
                    flexDirection: "row",
                    justifyContent: "space-evenly",
                  }}
                >
                  <Item style={cardStyle}>
                    <Typography
                      sx={{
                        color: "blue",
                        fontSize: "30px",
                        marginTop: "5px",
                      }}
                    >
                      500
                    </Typography>
                    <Typography>Orders</Typography>
                  </Item>{" "}
                  &nbsp;&nbsp;
                  <Item style={cardStyle}>
                    <Typography sx={{ color: "red", fontSize: "30px" }}>
                      200
                    </Typography>
                    <Typography>Delivered</Typography>
                  </Item>{" "}
                  &nbsp;&nbsp;
                  <Item style={cardStyle}>
                    <Typography sx={{ color: "#e6ae17", fontSize: "30px" }}>
                      100
                    </Typography>
                    <Typography>Pending</Typography>
                  </Item>{" "}
                  &nbsp;&nbsp;
                  <Item style={cardStyle}>
                    <Typography sx={{ color: "green", fontSize: "30px" }}>
                      500
                    </Typography>
                    <Typography>Packed</Typography>
                  </Item>
                </Box>
              </Card>

              <DashTab />
            </Grid>

            {/* Graph */}

            <Grid item xs={12} md={6}>
              <Item>
                <Box
                  sx={{
                    justifyContent: "space-between",
                    display: { xs: "block", sm: "flex" },
                    marginInline: "4%",
                    marginTop: "5%",
                  }}
                >
                  <Typography sx={{ color: "black", fontSize: "20px" }}>
                    Your Profile Views
                  </Typography>
                </Box>

                <Grid container justify="center">
                  <Grid item xs={12} sm={10} md={8} lg={6}>
                    <ResponsiveContainer width="100%" height={350}>
                      <LineChart data={data}>
                        <XAxis dataKey="name" />
                        <YAxis
                          ticks={[100, 150, 200, 250, 300, 350, 400]}
                          domain={[100, "dataMax"]}
                        />
                        <CartesianGrid stroke="grey" />
                        <Tooltip />
                        <Legend />
                        <Line
                          type="monotone"
                          dataKey="value"
                          stroke="blue"
                          activeDot={{ r: 8 }}
                        />
                      </LineChart>
                    </ResponsiveContainer>
                  </Grid>
                </Grid>
              </Item>

              <Item style={{ marginTop: "2%" }}>
                <Box
                  sx={{
                    display: "flex",
                    flexDirection: "row",
                    alignItems: "center",
                    justifyContent: "space-between",
                  }}
                >
                  <strong
                    style={{
                      fontWeight: "bold",
                      padding: "15px",
                      fontSize: "30px",
                    }}
                  >
                    Reviews
                  </strong>

                  <IconButton
                    size="large"
                    aria-label="display more actions"
                    edge="end"
                    color="inherit"
                  >
                    <MoreHorizIcon />
                  </IconButton>
                </Box>

                <Box sx={{display:'flex',}}>

                  <Box
                    sx={{
                      height: "70px",
                      width: "70px",
                      backgroundColor: "gray",
                      display: "flex",
                      justifyContent: "center",
                      alignItems: "center",
                      borderRadius: "20%",
                    }}
                  >
                    <FeedIcon
                      sx={{ color: "yellow", height: "45px", width: "45px" }}
                    />
                  </Box>

                  <Box
                    sx={{
                      display: "flex",
                      flexDirection: "column",
                    }}
                  >
                    <Typography sx={{ color: "black" }}>
                      <strong>Claudia Alves</strong>
                    </Typography>
                    <Typography sx={{ fontSize: "14px" }}>
                      Customer since 2019
                    </Typography>
                  </Box>

                </Box>
              </Item>
            </Grid>
          </Grid>
        </Box>
      </Grid>
    </>
  );
}
